>>> Lecture 6/5/06 -- Semantics (= evaluation) (PLAI chapter 2)     >>> Specifying the meaning of AE expressions  We want to define an *evaluation* function, that maps from an  expression, to some domain of values.  Lets regress a bit in terms of syntax: Assume the original, ambiguous AE grammar:   ::=     | +     | -   The evaluation function, *eval* is formally specified as:  a. eval( ) =  b. eval( + ) = eval( ) + eval( ) c. eval( - ) = eval( ) - eval( )  *NOTE* the different roles of "+" and "-", when they appear on the left side, and on the right side.  Is there a problem with the eval specification? Ambiguity --  eval(1 - 2 + 3) = ?  Two different evaluations are correct (i.e., match the specification) here:  1. eval(1 - 2 + 3) = eval(1 - 2) + eval(3)    (b)     eval(1 - 2) = eval(1) - eval(2)     (c)       = 1 - 2 = -1      (a,math)      eval(3) = 3         (a)   then eval(1 - 2 + 3) = -1 + 3 = 2      (math)   ======================================   2. eval(1 - 2 + 3) = eval(1) - eval(2 + 3)    (c)       = 1 - eval(2 + 3)     (a)     eval(2 + 3) = eval(2) + eval(3)     (b)       = 2 + 3 = 5       (a,math)   then eval(1 - 2 + 3) = 1 - 5 = -4      (math)   Ambiguity of the grammar ("1 - 2 + 3" has two different AST's) leads to nondeterministic evaluation  ========================================================================  Back to our non-ambiguous prefix-notation grammar, and implementing the eval function, specified as   eval( ) =   eval({+ }) = eval( ) + eval( )  eval({- }) = eval( ) - eval( )  This will be its contract:  ;; eval: AE -> Number ;; Consumes an AE and computes the corresponding number  which leads to some obvious test cases:   (= 3 (eval (parse "3")))  (= 7 (eval (parse "{+ 3 4}")))  (= 6 (eval (parse "{+ {- 3 4} 7}")))  Recall our AE datatype definition:   (define-type AE  [Num (n number?)]  [Add (lhs AE?) (rhs AE?)]  [Sub (lhs AE?) (rhs AE?)]  [Mul (lhs AE?) (rhs AE?)])  >>> Interlude: Deconstructing AE, and Variant Records  The `cases' form:  This is the dual of `define-type': Whereas `define-type' defines new AST type constructors, `cases' is used to deconstruct (or destruct) AST structures.  We define it by example: The type AE has 4 variants:  (Num n)  (Add lhs rhs)  (Sub lhs rhs)  (Mul lhs rhs)  Then a `cases' expression deconstructs an expr of type AE into each variant:   (cases expr  [(Num n) ...]  [(Add lhs rhs) ...]  [(Sub lhs rhs) ...]  [(Mul lhs rhs) ...])  where `...' is some Scheme expression. The value of the whole `cases' expression is the value of the expression corresponding to the variant that matches `expr'.       Types like AE are known as *variant records*, or *discriminated unions*.  A variant record provides a number of alternative sets of fields, only one of which is valid at any given time (Scott, 'Programming Language Pragmatics', chapt. 7). Each alternative of a variant record is known as a *variant*. The tag, or *discriminant*, of the variant record (e.g.,`Num', `Add', `Sub', or `Mul') denotes which variant is active.  (Num n) (Add x y) (Sub x y)  The form of variant record we use is closely modeled after ML.  Languages like Ada and Algol 68 provide a similar (though more cumbersome) form.  Pascal and C provide a more primitive, type-unsafe form. In C:   union {int a; float b;} foo;  denotes a variant record `foo'. At any time, only one of the fields `foo.a' and `foo.b' has a valid value. The problem is that in C there is no discriminant, so the following dangerous program is quite valid, though it will print out random garbage:   union {int a; float b;} foo;  foo.b = 5.6;  printf("value: %d", foo.a);  >>> The Evaluator  Since eval's input (an AE) is recursive, eval's implementation (which is also its formal definition) is naturally recursive, and its structure follows from the structure of the input:   ;; eval: AE -> Number  ;; Consumes an AE and computes the corresponding number  (define (eval expr)  (cases expr   [(Num n) ...]   [(Add l r) ... (eval l) ... (eval r) ...]   [(Sub l r) ... (eval l) ... (eval r) ...]))  What goes in the gaps?    (define (eval expr)  (cases expr   [(Num n) n]   [(Add l r) (+ (eval l) (eval r))]   [(Sub l r) (- (eval l) (eval r))]   [(Mul l r) (* (eval l) (eval r))]))   ========================================================================   We can combine this with the parser, to derive the full interpreter:  ;; run: String -> Number ;; Evaluate an AE program, given as a string (define (run str)  (eval (parse str)))  ;; Tests (= 3 (run "3")) (= 7 (run "{+ 3 4}")) (= 6 (run "{+ {- 3 4} 7}")) (= 24 (run "{* 6 4}")) (= -12 (run "{* 6 {- 2 4}}"))  ========================================================================  Here is the full code  ;; AE abstract syntax tree type (define-type AE  [Num (n number?)]  [Add (lhs AE?) (rhs AE?)]  [Sub (lhs AE?) (rhs AE?)]  [Mul (lhs AE?) (rhs AE?)])  ;; parse-sexpr: sexpr -> AE ;; Translates from s-expressions to AE's, or signals error on badly formed input (define (parse-sexpr sexpr)  (cond [(number? sexpr) (Num sexpr)]   [(and (list? sexpr) (= 3 (length sexpr)))    (let ([make-node     (cond [(eq? (first sexpr) '+) Add]       [(eq? (first sexpr) '-) Sub]       [(eq? (first sexpr) '*) Mul]       [else (error 'parse-sexpr "don't know about ~s"          (first sexpr))])])    (make-node (parse-sexpr (second sexpr))       (parse-sexpr (third sexpr))))]   [else (error 'parse-sexpr "bad syntax in ~s" sexpr)]))  ;; parse : string -> AE ;; parses a string containing an AE expression to an AE (define (parse str)  (parse-sexpr (string->sexpr str)))  ;; Tests (equal? (Num 3) (parse "3")) (equal? (Add (Num 3) (Num 4)) (parse "{+ 3 4}")) (equal? (Sub (Num 3) (Num 4)) (parse "{- 3 4}")) (equal? (Sub (Num 3) (Add (Num 3) (Num 4))) (parse "{- 3 {+ 3 4}}"))  ;; eval: AE -> Number ;; Consumes an AE and computes the corresponding number (define (eval expr)  (cases expr   [(Num n) n]   [(Add l r) (+ (eval l) (eval r))]   [(Sub l r) (- (eval l) (eval r))]   [(Mul l r) (* (eval l) (eval r))]))  ;; run: String -> Number ;; Evaluate an AE program, given as a string (define (run str)  (eval (parse str)))  ;; Tests (= 3 (run "3")) (= 7 (run "{+ 3 4}")) (= 6 (run "{+ {- 3 4} 7}")) (= 24 (run "{* 6 4}")) (= -12 (run "{* 6 {- 2 4}}"))  ========================================================================  ;; Local variables: ;; fill-column: 72 ;; enable-local-eval: t ;; eval:(add-color-pattern "^=\{72\}
